// import styles from '../styles/Home.module.css';
import Header from '../components/layout/Header';
import AboutSection from '../components/AboutSection';
import RepoSection from '../components/RepoSection';
import NoteSection from '../components/NoteSection';
import Footer from '../components/layout/Footer';
import Navigation from '../components/layout/Navigation';

export default function Home({ reposData }) {
  return (
    <div>
      <nav>{/* <Navigation /> */}</nav>
      <header>
        <Header />
      </header>
      <main>
        <AboutSection />
        <RepoSection reposData={reposData} />
        <NoteSection />
      </main>
      <footer>
        <Footer />
      </footer>
    </div>
  );
}

export async function getStaticProps() {
  const repoApi = 'https://api.github.com/users/barrystone/repos';

  const reposData = await fetch(repoApi).then((res) => res.json());

  return {
    props: {
      reposData,
    },
  };
}

//Integrate with LogRocket

// you can import these packages anywhere
const LogRocket = require('logrocket');
const setupLogRocketReact = require('logrocket-react');

// only initialize when in the browser
if (typeof window !== 'undefined') {
  LogRocket.init('okfu8y/github-io');
  // plugins should also only be initialized when in the browser
  setupLogRocketReact(LogRocket);
}

LogRocket.identify('okfu8y', {
  name: 'Barry Stone',
  // email: 'barry@gmail.com',
});
